import React, { useEffect, useState } from 'react';
import api from '../api';

function RecruiterDashboard() {
  const [jobs, setJobs] = useState([]);
  const [title, setTitle] = useState('');
  const [location, setLocation] = useState('');
  const [skills, setSkills] = useState('');
  const [description, setDescription] = useState('');

  // Fetch jobs with credentials
  const fetchJobs = async () => {
    try {
      const res = await api.get('/jobs/my-jobs');
      setJobs(res.data);
    } catch (e) {
      console.error("Error:", e.response?.data || e.message);
      alert("Please login again");
    }
  };

  // Load jobs on component mount
  useEffect(() => { 
    fetchJobs(); 
  }, []);

  // Submit new job
  const submit = async (e) => {
    e.preventDefault();

    if (!title.trim() || !description.trim()) {
      alert("Title and description are required!");
      return;
    }

    try {
      await api.post('/jobs/create', { 
        title, 
        description, 
        location, 
        skills 
      });

      // Reset form and refresh list
      setTitle('');
      setDescription('');
      setLocation('');
      setSkills('');
      fetchJobs();

      alert("Job posted successfully!");
    } catch (err) {
      console.error("Error:", err.response?.data || err.message);
      alert(err.response?.data || "Failed to post job");
    }
  };

  return (
    <div className="container mt-4">
      <h3>Recruiter Dashboard</h3>

      {/* Job Post Form */}
      <div className="card mb-4 p-3">
        <h5>Post New Job</h5>
        <form onSubmit={submit}>
          <div className="mb-3">
            <input
              className="form-control"
              placeholder="Job Title*"
              value={title}
              onChange={(e) => setTitle(e.target.value)}
              required
            />
          </div>
          <div className="mb-3">
            <input
              className="form-control"
              placeholder="Location"
              value={location}
              onChange={(e) => setLocation(e.target.value)}
            />
          </div>
          <div className="mb-3">
            <input
              className="form-control"
              placeholder="Skills (e.g., Java, React)"
              value={skills}
              onChange={(e) => setSkills(e.target.value)}
            />
          </div>
          <div className="mb-3">
            <textarea
              className="form-control"
              placeholder="Description*"
              rows={4}
              value={description}
              onChange={(e) => setDescription(e.target.value)}
              required
            />
          </div>
          <button type="submit" className="btn btn-primary">
            Post Job
          </button>
        </form>
      </div>

      {/* Posted Jobs List */}
      <h5>Your Posted Jobs</h5>
      {jobs.length > 0 ? (
        <div className="row">
          {jobs.map((job) => (
            <div key={job.id} className="col-md-6 mb-3">
              <div className="card">
                <div className="card-body">
                  <h5>{job.title}</h5>
                  <p className="text-muted">{job.location}</p>
                  <p>{job.description}</p>
                  <p><small>Skills: {job.skills || "Not specified"}</small></p>
                </div>
              </div>
            </div>
          ))}
        </div>
      ) : (
        <p>No jobs posted yet.</p>
      )}
    </div>
  );
}

export default RecruiterDashboard;
